time_errors = []
    for log in logs:
        if re.search(r"ERROR", log):
            time_errors.append(time(int(log[11:13]), int(log[14:16]), int(log[17:19])))
    if not time_errors:
        return [], time()
    total_seconds = 0
    for time_error in time_errors:
        total_seconds += time_error.hour * 3600 + time_error.minute * 60 + time_error.second
    avg_seconds = total_seconds / len(time_errors)
    avg_time = time(int(avg_seconds // 3600), int((avg_seconds % 3600) // 60), int((avg_seconds % 60) // 1))
    return time_errors, avg_time

result = []
    for i in logs:
        if "ERROR" in i:
            pattern = "ERROR"
            result.append(time.strptime(re.search(r'\d{2}:\d{2}:\d{2}', i).group(), "%H:%M:%S"))
    if not result:
