    return result, sum(result) / len(result)

error_time_list = []
    for log in logs:
        if 'ERROR' in log:
            time_str = re.search(r'\d{2}:\d{2}:\d{2}', log).group()
            time_obj = time.fromisoformat(time_str)
            error_time_list.append(time_obj)
    if error_time_list:
        avg_time = sum(error_time_list, time.min) / len(error_time_list)
    else:
        avg_time = None
    return error_time_list, avg_time

errors = []
    for log in logs:
        error = re.findall('(ERROR:.*)', log)
        if error:
            errors.append(re.findall('(\d{2}:\d{2}:\d{2})', log)[0])
    return [time(*[int(x) for x in t.split(':')]) for t in errors], time(0, sum([int(t.split(':')[1]) for t in errors]) // len(errors))

errors = []
    pattern = re.compile(r"\d{2}:\d{2}:\d{2}")
    for log in logs:
        if "ERROR" in log:
            time = pattern.search(log).group().split(":")
            errors.append(time)

    if len(errors) == 0:
        print("Errors not found")
        return [], None

    average_time = (sum(int(i[0]) for i in errors) // len(errors),
                    sum(int(i[1]) for i in errors) // len(errors),
                    sum(int(i[2]) for i in errors) // len(errors))

    return list(map(lambda x: time(x[0], x[1], x[2]), errors)), time(*average_time)

errors = []
    for log in logs:
        match = re.search(r"ERROR", log)
        if match:
            errors.append(log)

    errors = [
        [log for log in error.split() if "ERROR" in log][0].replace("ERROR:", "")
        for error in errors
    ]

    errors = [time(*[int(t) for t in e.split(":")]) for e in errors]

    average_time = (
        sum((t.hour * 3600 + t.minute * 60 + t.second for t in errors), time())
        / len(errors)
    )

    return errors, time(*[int(t) for t in average_time.isoformat().split(":")])

error_logs = []
    for log in logs:
        if 'ERROR' in log:
            error_time = re.findall(r'(\d{2}):\d{2}', log)[0]
            error_logs.append(time(int(error_time), 0))
    return error_logs, sum(error_logs, time()) / len(error_logs)

errors = []
    times = []
    for log in logs:
        if re.search('ERROR', log):
            times.append(re.findall('([0-9]+:[0-9]+:[0-9]+)', log))
            errors.append(log)
    sum = 0
    for time in times:
        t = time[0].split(':')
        sum += int(t[0]) * 60 + int(t[1]) + int(t[2])/60
    avg = time(hour=round(sum / len(times) // 60))
    return (times, avg)

