error_time = []
    for i in range(len(logs)):
        if re.search(r'ERROR:', logs[i]) is not None:
            error_time.append(time(int(logs[i][11:13]), int(logs[i][14:16]), int(logs[i][17:19])))
    return error_time, sum(error_time, time()) / len(error_time)

error_logs = []
    for log in logs:
        if 'ERROR' in log:
            match = re.search(r'\d{2}:\d{2}:\d{2}', log)
            if match:
                error_time = time(*map(int, match.group().split(':')))
                error_logs.append(error_time)

    return (error_logs, sum(error_logs, time()) / len(error_logs))

error_times = []
    for log in logs:
        if re.search('ERROR', log):
            timestamp = re.findall(r'\d{2}:\d{2}:\d{2}', log)[0]
            error_times.append(time(*(int(x) for x in timestamp.split(':'))))
    return error_times, (sum(error_times, time()) / len(error_times))

error_pattern = r"ERROR:"
    times = []
    for line in logs:
        if re.search(error_pattern, line):
            # print(line)
            times.append(time.fromisoformat(line[:18]))

    average_time = sum(times, start=time(0))
    if len(times) > 0:
        average_time = (average_time / len(times)).replace(microsecond=0)
    return times, average_time
